import React, { Component } from 'react'
import logo from '../assets/adidas.png'
import menuimg from '../assets/menu.png'

import './Navbar.css'


export default  class navbar extends Component {


  


  render() {

    const togglemenu =()=>{
          
        var navb= document.getElementsByClassName("navbar");
        var navul= document.getElementsByClassName("navul");

        navb.style({
            display:"block"
        })



    }


    return (
      <div className='navbar'>
        
            
        <img src={logo}/>


        <img onClick={togglemenu} className='menuimg' src={menuimg}/>
        <ul className="nav navul justify-content-center">
            <li className="nav-item">
                <a className="nav-link active links" href="#">Home</a>
            </li>
            <li className="nav-item">
                <a className="nav-link links" href="#">programes</a>
            </li>
            <li className="nav-item">
                <a className="nav-link active links" href="#">Why us</a>
            </li>

            <li className="nav-item">
                <a className="nav-link active links" href="#">Plan</a>
            </li>

            <li className="nav-item">
                <a className="nav-link active links" href="#">testmonials</a>
            </li>
        </ul>
      </div>
    )
  }
}
